$(document).ready(function(){var s=$(".js-sponsors-list");if(s.length>0){new SponsorsPage(s)}});var SponsorsPage=function(s){this.$container=s,this.init()};SponsorsPage.prototype.init=function(){var s=this;this.$container.isotope({itemSelector:".js-sponsors-list-item",masonry:{columnWidth:155,gutter:5}}),$(".js-sponsors-list-item").click(function(t){var i=$(this);if(!$(t.target).closest("a").length){if(i.hasClass("active-item"))i.find(".js-sponsors-list-item-more").hide(),i.removeClass("active-item");else{var e=$(".js-sponsors-list-item.active-item");e.find(".js-sponsors-list-item-more").hide(),e.removeClass("active-item"),i.addClass("active-item"),i.find(".js-sponsors-list-item-more").fadeIn()}s.$container.isotope("layout")}})};